from heapq import *
import numpy as np


def cheapest_path(t, start, finish):
    w = len(t[0])
    s = start[1] + start[0] * w
    f = finish[1] + finish[0] * w

    graph = make_graph(t)
    path = dijkstra(graph, s, f)

    if len(path) == 1:
        return []

    return list(decode(path, w))


def decode(path, w):
    c = path[0]
    for i in range(1, len(path)):
        v = path[i]
        if v == c + 1:
            yield "right"
        if v == c - 1:
            yield "left"
        if v == c + w:
            yield "down"
        if v == c - w:
            yield "up"
        c = v


def make_graph(t):
    i = 0
    mx = len(t[0])
    my = len(t)
    n = mx * my
    graph = [[] for y in range(n)]
    for y in range(my):
        for x in range(mx):
            for c in siblings(x, y, mx, my):
                graph[i].append((c, t[y][x]))
            i += 1
    return graph


def dijkstra(graph, s, f):
    n = len(graph)
    q = [(0, s, ())]
    t = []
    visited = [False] * n

    while q:
        (cost, v1, path) = heappop(q)
        if not visited[v1]:
            visited[v1] = True
            path = (v1, path)
            if v1 == f:
                p = []
                while path:
                    p.insert(0, path[0])
                    path = path[1]
                return p

            for v2, c in graph[v1]:
                if not visited[v2]:
                    nxt = cost + c
                    heappush(q, (nxt, v2, path))
    return None


def siblings(x, y, mx, my):
    if x > 0:
        yield x - 1 + y * mx
    if x < mx - 1:
        yield x + 1 + y * mx
    if y > 0:
        yield x + (y - 1) * mx
    if y < my - 1:
        yield x + (y + 1) * mx


def printf(t):
    print("-----------------------------------")
    for r in t:
        print(" ".join([(str(d) if d != np.inf else "-").rjust(2) for d in r]))


